<h1 id="Africa-Education">Africa Education<a class="anchor-link" href="#Africa-Education">&#182;</a></h1><p>This notebook is an example on how to use the Vertica ML Python Library. We will use the Africa Education dataset to predict students scores at school. You can download the Jupyter Notebook of the study by clicking <a href="africa_education.ipynb">here</a> and the dataset by clicking <a href="../data/africa_education.csv">here</a>. To achieve our goals, we have access to many different features.</p>
