<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h2 id="Machine-Learning:-Finding-Clusters-using-lat/long">Machine Learning: Finding Clusters using lat/long<a class="anchor-link" href="#Machine-Learning:-Finding-Clusters-using-lat/long">&#182;</a></h2>
</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>A natural idea when we have data on the school location is to find school clusters based on proximity rather than countries borders. These clusters can be used as inputs by our model.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[7]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="kn">from</span> <span class="nn">vertica_ml_python.learn.plot</span> <span class="k">import</span> <span class="n">elbow</span>
<span class="n">x</span> <span class="o">=</span> <span class="n">elbow</span><span class="p">(</span><span class="n">X</span> <span class="o">=</span> <span class="p">[</span><span class="s2">&quot;lon&quot;</span><span class="p">,</span> <span class="s2">&quot;lat&quot;</span><span class="p">],</span>
          <span class="n">input_relation</span> <span class="o">=</span> <span class="s2">&quot;africa_education_clean&quot;</span><span class="p">,</span>
          <span class="n">n_cluster</span> <span class="o">=</span> <span class="p">(</span><span class="mi">1</span><span class="p">,</span> <span class="mi">30</span><span class="p">))</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
