<h2 id="Machine-Learning:-Understanding-the-final-Student-Scores">Machine Learning: Understanding the final Student Scores<a class="anchor-link" href="#Machine-Learning:-Understanding-the-final-Student-Scores">&#182;</a></h2><p>As the math score is highly correlated to the reading score, we can use only one of the variables to do the prediction. Let's use a cross validation to see if our variables have enough information to predict the students scores.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[11]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="kn">from</span> <span class="nn">vertica_ml_python.learn.ensemble</span> <span class="k">import</span> <span class="n">RandomForestRegressor</span>
<span class="kn">from</span> <span class="nn">vertica_ml_python.learn.model_selection</span> <span class="k">import</span> <span class="n">cross_validate</span>
<span class="n">predictors</span> <span class="o">=</span> <span class="n">africa</span><span class="o">.</span><span class="n">get_columns</span><span class="p">(</span><span class="n">exclude_columns</span> <span class="o">=</span> <span class="p">[</span><span class="s2">&quot;zralocp&quot;</span><span class="p">,</span> 
                                                   <span class="s2">&quot;zmalocp&quot;</span><span class="p">,</span> 
                                                   <span class="s2">&quot;split&quot;</span><span class="p">,</span> 
                                                   <span class="s2">&quot;lat&quot;</span><span class="p">,</span> 
                                                   <span class="s2">&quot;lon&quot;</span><span class="p">,</span>
                                                   <span class="s2">&quot;schoolname&quot;</span><span class="p">])</span>
<span class="n">response</span> <span class="o">=</span> <span class="s2">&quot;zralocp&quot;</span>
<span class="n">model</span> <span class="o">=</span> <span class="n">RandomForestRegressor</span><span class="p">(</span><span class="n">name</span> <span class="o">=</span> <span class="s2">&quot;africa_rf&quot;</span><span class="p">,</span>
                              <span class="n">n_estimators</span> <span class="o">=</span> <span class="mi">40</span><span class="p">,</span>
                              <span class="n">max_depth</span> <span class="o">=</span> <span class="mi">20</span><span class="p">,</span>
                              <span class="n">min_samples_leaf</span> <span class="o">=</span> <span class="mi">4</span><span class="p">,</span>
                              <span class="n">nbins</span> <span class="o">=</span> <span class="mi">20</span><span class="p">,</span>
                              <span class="n">sample</span> <span class="o">=</span> <span class="mf">0.7</span><span class="p">)</span>
<span class="n">cross_validate</span><span class="p">(</span><span class="n">model</span><span class="p">,</span> 
               <span class="n">input_relation</span> <span class="o">=</span> <span class="s2">&quot;africa_education_clusters&quot;</span><span class="p">,</span>
               <span class="n">X</span> <span class="o">=</span> <span class="n">predictors</span><span class="p">,</span> 
               <span class="n">y</span> <span class="o">=</span> <span class="n">response</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

