olid white;">0.49262516779305</td></tr><tr ><td style="font-size:1.02em;background-color:#263133;color:white"><b>avg</b></td><td style="border: 1px solid white;">0.493456781541822</td><td style="border: 1px solid white;">423.7934913030683</td><td style="border: 1px solid white;">45.69085516159767</td><td style="border: 1px solid white;">56.22649210452553</td><td style="border: 1px solid white;">5229.46660810481</td><td style="border: 1px solid white;">0.493406009041374</td></tr><tr ><td style="font-size:1.02em;background-color:#263133;color:white"><b>std</b></td><td style="border: 1px solid white;">0.001065191320199075</td><td style="border: 1px solid white;">34.73725772313862</td><td style="border: 1px solid white;">0.20334726666153466</td><td style="border: 1px solid white;">0.06225190940844914</td><td style="border: 1px solid white;">15.450324810440096</td><td style="border: 1px solid white;">0.0010263113913230712</td></tr></table>
