<div class=" highlight hl-ipython3"><pre><span></span><span class="n">model</span><span class="o">.</span><span class="n">fit</span><span class="p">(</span><span class="n">input_relation</span> <span class="o">=</span> <span class="s2">&quot;africa_education_clusters&quot;</span><span class="p">,</span> 
          <span class="n">X</span> <span class="o">=</span> <span class="n">predictors</span><span class="p">,</span> 
          <span class="n">y</span> <span class="o">=</span> <span class="n">response</span><span class="p">)</span>
<span class="n">predictors</span> <span class="o">=</span> <span class="n">model</span><span class="o">.</span><span class="n">features_importance</span><span class="p">()</span><span class="o">.</span><span class="n">values</span><span class="p">[</span><span class="s2">&quot;index&quot;</span><span class="p">]</span>
</pre></div>

</div>
