</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>We can see the importance of the socio-economical statut and the country of the students. These factors can really influence the students work quality as having very bad studying conditions can lead to bad results (Examples: Country having an unstable government or Students having difficulties at home). For now, let's only consider the 20th most important variables. We can create a train and a test set using the 'split' variable created previously.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[13]:</div>
<div class="inner_cell">
    <div class="input_area">
