<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>Let's compute some statistics to understand what makes a student good, intermediate or bad. First, let's compute a bubble plot using the two scores.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[19]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">x</span> <span class="o">=</span> <span class="n">africa</span><span class="o">.</span><span class="n">bubble</span><span class="p">(</span><span class="n">columns</span> <span class="o">=</span> <span class="p">[</span><span class="s2">&quot;zralocp&quot;</span><span class="p">,</span> <span class="s2">&quot;zmalocp&quot;</span><span class="p">],</span>
                  <span class="n">size_bubble_col</span> <span class="o">=</span> <span class="s2">&quot;zpses&quot;</span><span class="p">,</span>
                  <span class="n">catcol</span> <span class="o">=</span> <span class="s2">&quot;PENGLISH&quot;</span><span class="p">,</span>
                  <span class="n">max_nb_points</span> <span class="o">=</span> <span class="mi">2000</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
