<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>We can see a clear influence of the home language and the socio-economic status. The bilingual students (speaking all the time english at home) are not the best ones. It is enough for a student to speak often english to be brillant. Besides the socio-economic status influences a lot the students scores. Students speaking often english at home and having a comfortable standard of living are the best ones. Let's now look at the influence of the Country.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[20]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">x</span> <span class="o">=</span> <span class="n">africa</span><span class="p">[</span><span class="s2">&quot;country_long&quot;</span><span class="p">]</span><span class="o">.</span><span class="n">hist</span><span class="p">(</span><span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;90%&quot;</span><span class="p">,</span> 
                                <span class="n">of</span> <span class="o">=</span> <span class="s2">&quot;pred_zmalocp&quot;</span><span class="p">,</span>
                                <span class="n">max_cardinality</span> <span class="o">=</span> <span class="mi">50</span><span class="p">)</span>
<span class="n">x</span> <span class="o">=</span> <span class="n">africa</span><span class="p">[</span><span class="s2">&quot;country_long&quot;</span><span class="p">]</span><span class="o">.</span><span class="n">hist</span><span class="p">(</span><span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;10%&quot;</span><span class="p">,</span> 
                                <span class="n">of</span> <span class="o">=</span> <span class="s2">&quot;pred_zmalocp&quot;</span><span class="p">,</span>
                                <span class="n">max_cardinality</span> <span class="o">=</span> <span class="mi">50</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




