<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>The country really influences the score. For example, Swaziland, Kenya and Tanzanie are probably over-rating the bad students (90% of the scores are greater than the average (500)) whereas some countries like Zambia, South Africa and Malawi are under-rating their students (90% of the scores are under 480). It could be related to the global education in the country. Some education systems could be harder than the others. Let's now look at the different regions.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[21]:</div>
<div class="inner_cell">
