<div class=" highlight hl-ipython3"><pre><span></span><span class="n">x</span> <span class="o">=</span> <span class="n">africa</span><span class="p">[</span><span class="s2">&quot;REGION&quot;</span><span class="p">]</span><span class="o">.</span><span class="n">hist</span><span class="p">(</span><span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;50%&quot;</span><span class="p">,</span> 
                          <span class="n">of</span> <span class="o">=</span> <span class="s2">&quot;pred_zmalocp&quot;</span><span class="p">,</span>
                          <span class="n">max_cardinality</span> <span class="o">=</span> <span class="mi">50</span><span class="p">)</span>
<span class="n">x</span> <span class="o">=</span> <span class="n">africa</span><span class="p">[</span><span class="s2">&quot;province&quot;</span><span class="p">]</span><span class="o">.</span><span class="n">hist</span><span class="p">(</span><span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;50%&quot;</span><span class="p">,</span> 
                            <span class="n">of</span> <span class="o">=</span> <span class="s2">&quot;pred_zmalocp&quot;</span><span class="p">,</span>
                            <span class="n">max_cardinality</span> <span class="o">=</span> <span class="mi">50</span><span class="p">)</span>
</pre></div>

