</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>Young students are globally better than the others. It is mainly because the oldest have difficulties to succeed. It can be due to the country political situation (For example, a country at war can bring too much responsabilities to children). Let's now look at the variables 'PLIGHT' and 'PREPEAT'.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[31]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">x</span> <span class="o">=</span> <span class="n">africa</span><span class="o">.</span><span class="n">hist</span><span class="p">(</span><span class="n">columns</span> <span class="o">=</span> <span class="p">[</span><span class="s2">&quot;PREPEAT&quot;</span><span class="p">,</span> <span class="s2">&quot;PLIGHT&quot;</span><span class="p">],</span>
                <span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;avg&quot;</span><span class="p">,</span> 
                <span class="n">of</span> <span class="o">=</span> <span class="s2">&quot;pred_zmalocp&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>We can see that people who never repeated the year and having light at home are in general better at school than the others. Let's now look on how students go to school.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[24]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">x</span> <span class="o">=</span> <span class="n">africa</span><span class="p">[</span><span class="s2">&quot;ptravel2&quot;</span><span class="p">]</span><span class="o">.</span><span class="n">hist</span><span class="p">(</span><span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;50%&quot;</span><span class="p">,</span> 
                            <span class="n">of</span> <span class="o">=</span> <span class="s2">&quot;pred_zmalocp&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>We can clearly see that students who have to do a lot of efforts to go to school have more difficulties than the others. Let's now look at the teacher level.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[25]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">x</span> <span class="o">=</span> <span class="n">africa</span><span class="p">[</span><span class="s2">&quot;zraloct&quot;</span><span class="p">]</span><span class="o">.</span><span class="n">hist</span><span class="p">(</span><span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;50%&quot;</span><span class="p">,</span>
                           <span class="n">of</span> <span class="o">=</span> <span class="s2">&quot;pred_zmalocp&quot;</span><span class="p">,</span>
                           <span class="n">h</span> <span class="o">=</span> <span class="mi">100</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>Good teachers lead generally to better results. Let's look at the influence of the 'district'.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[26]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">x</span> <span class="o">=</span> <span class="n">africa</span><span class="p">[</span><span class="s2">&quot;district&quot;</span><span class="p">]</span><span class="o">.</span><span class="n">hist</span><span class="p">(</span><span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;50%&quot;</span><span class="p">,</span>
                           <span class="n">of</span> <span class="o">=</span> <span class="s2">&quot;pred_zmalocp&quot;</span><span class="p">,</span>
                           <span class="n">h</span> <span class="o">=</span> <span class="mi">100</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>Some districts can also lead to better results (example: Chicualacuala with a median score of 700)</p>
<p>To help students at school, some countries might have to change their expectations. Hard courses can bring down the motivation of some students as they are just children. Helping the students of poor families by creating extra school activities can help many students to do their best to succeed. Bringing light to more houses can also be an efficient method to help more students to succeed at school. Creating more public transports is also very important as students having difficult means of transports to go to school are more subject to bad global scores.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h2 id="Machine-Learning:-Finding-the-Best-Pupils">Machine Learning: Finding the Best Pupils<a class="anchor-link" href="#Machine-Learning:-Finding-the-Best-Pupils">&#182;</a></h2>
</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>To find the best pupils we can use the 'School' ID and compute the averaged score. We can then order by the averaged score desc and keep the top 5 students in each school.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[27]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="kn">from</span> <span class="nn">vertica_ml_python</span> <span class="k">import</span> <span class="o">*</span>
<span class="n">africa</span> <span class="o">=</span> <span class="n">vDataFrame</span><span class="p">(</span><span class="s2">&quot;africa_education_clean&quot;</span><span class="p">)</span>
<span class="c1"># Computing the averaged score</span>
<span class="n">africa</span><span class="o">.</span><span class="n">eval</span><span class="p">(</span><span class="n">name</span> <span class="o">=</span> <span class="s2">&quot;score&quot;</span><span class="p">,</span> 
            <span class="n">expr</span> <span class="o">=</span> <span class="s2">&quot;(zralocp + zmalocp) / 2&quot;</span><span class="p">)</span>
<span class="c1"># Computing the averaged student score</span>
<span class="n">africa</span><span class="o">.</span><span class="n">analytic</span><span class="p">(</span><span class="n">func</span> <span class="o">=</span> <span class="s2">&quot;row_number&quot;</span><span class="p">,</span>
                <span class="n">by</span> <span class="o">=</span> <span class="p">[</span><span class="s2">&quot;schoolname&quot;</span><span class="p">],</span>
                <span class="n">order_by</span> <span class="o">=</span> <span class="p">{</span><span class="s2">&quot;score&quot;</span><span class="p">:</span> <span class="s2">&quot;desc&quot;</span><span class="p">},</span>
                <span class="n">name</span> <span class="o">=</span> <span class="s2">&quot;student_class_position&quot;</span><span class="p">)</span>
<span class="c1"># Finding the 3 best students by class</span>
<span class="n">africa</span><span class="o">.</span><span class="n">case_when</span><span class="p">(</span><span class="n">name</span> <span class="o">=</span> <span class="s2">&quot;best&quot;</span><span class="p">,</span>
                 <span class="n">conditions</span> <span class="o">=</span> <span class="p">{</span><span class="s2">&quot;student_class_position &lt;= 5&quot;</span><span class="p">:</span> <span class="mi">1</span><span class="p">},</span>
                 <span class="n">others</span> <span class="o">=</span> <span class="mi">0</span><span class="p">)</span>
<span class="c1"># Selecting the main variables</span>
<span class="n">africa</span> <span class="o">=</span> <span class="n">africa</span><span class="o">.</span><span class="n">select</span><span class="p">([</span><span class="s2">&quot;PENGLISH&quot;</span><span class="p">,</span> 
                        <span class="s2">&quot;PAGE&quot;</span><span class="p">,</span> 
                        <span class="s2">&quot;zmaloct&quot;</span><span class="p">,</span> 
                        <span class="s2">&quot;zpses&quot;</span><span class="p">,</span> 
                        <span class="s2">&quot;PREPEAT&quot;</span><span class="p">,</span> 
                        <span class="s2">&quot;country_long&quot;</span><span class="p">,</span>
                        <span class="s2">&quot;PTRAVEL2&quot;</span><span class="p">,</span> 
                        <span class="s2">&quot;PLIGHT&quot;</span><span class="p">,</span>
                        <span class="s2">&quot;REGION&quot;</span><span class="p">,</span>
                        <span class="s2">&quot;SLOCAT&quot;</span><span class="p">,</span>
                        <span class="s2">&quot;best&quot;</span><span class="p">,</span>
                        <span class="s2">&quot;zpmealsc&quot;</span><span class="p">,</span>
                        <span class="s2">&quot;PFATHER&quot;</span><span class="p">,</span>
                        <span class="s2">&quot;SPUPPR04&quot;</span><span class="p">,</span>
                        <span class="s2">&quot;PNURSERY&quot;</span><span class="p">,</span>
                        <span class="s2">&quot;PABSENT&quot;</span><span class="p">])</span>
<span class="c1"># Getting the categories dummies for the Logistic Regression</span>
<span class="n">africa</span><span class="o">.</span><span class="n">get_dummies</span><span class="p">(</span><span class="n">columns</span> <span class="o">=</span> <span class="p">[</span><span class="s2">&quot;REGION&quot;</span><span class="p">,</span> 
                              <span class="s2">&quot;PLIGHT&quot;</span><span class="p">,</span> 
                              <span class="s2">&quot;PTRAVEL2&quot;</span><span class="p">,</span> 
                              <span class="s2">&quot;country_long&quot;</span><span class="p">,</span>
                              <span class="s2">&quot;PREPEAT&quot;</span><span class="p">,</span>
                              <span class="s2">&quot;PENGLISH&quot;</span><span class="p">,</span>
                              <span class="s2">&quot;SLOCAT&quot;</span><span class="p">,</span>
                              <span class="s2">&quot;PFATHER&quot;</span><span class="p">,</span>
                              <span class="s2">&quot;SPUPPR04&quot;</span><span class="p">,</span>
                              <span class="s2">&quot;PNURSERY&quot;</span><span class="p">,</span>
                              <span class="s2">&quot;PABSENT&quot;</span><span class="p">,</span>
                              <span class="s2">&quot;zpmealsc&quot;</span><span class="p">],</span>
                   <span class="n">max_cardinality</span> <span class="o">=</span> <span class="mi">1000</span><span class="p">)</span>
<span class="c1"># Exporting the table</span>
<span class="n">drop_table</span><span class="p">(</span><span class="s2">&quot;best_students&quot;</span><span class="p">)</span>
<span class="n">africa</span><span class="o">.</span><span class="n">to_db</span><span class="p">(</span><span class="n">name</span> <span class="o">=</span> <span class="s2">&quot;best_students&quot;</span><span class="p">,</span>
             <span class="n">relation_type</span> <span class="o">=</span> <span class="s2">&quot;table&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

